DROP TABLE IF EXISTS `location_citymuni`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `location_citymuni` (
  `region_code` varchar(2) NOT NULL COMMENT 'Refers to PSGC Region',
  `province_code` varchar(2) NOT NULL COMMENT 'Refers to PSGC Province',
  `district_code` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Refers to PSGC District',
  `citymuni_code` varchar(2) NOT NULL COMMENT 'PSGC City or Municipality Code',
  `citymuni_name` varchar(100) NOT NULL COMMENT 'Name of city or municipality',
  `lgu_type` enum('HUC','CC','ICC','M') DEFAULT NULL COMMENT 'Refers to type of LGU',
  `active_flag` enum('Y','N') NOT NULL DEFAULT 'Y' COMMENT 'Tagging if the record is Active (Y) or Inactive (N)',
  `created_by` mediumint(8) unsigned NOT NULL COMMENT 'Refers to user who created the record',
  `created_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Date when the record was created',
  `modified_by` mediumint(8) unsigned DEFAULT NULL COMMENT 'Refers to the user who modified the record',
  `modified_date` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT 'Date when the record was modified',
  PRIMARY KEY (`region_code`,`province_code`,`district_code`,`citymuni_code`),
  KEY `fk_location_citymuni_location_provinces1_idx` (`region_code`,`province_code`),
  CONSTRAINT `fk_location_citymuni_location_provinces1` FOREIGN KEY (`region_code`, `province_code`) REFERENCES `location_provinces` (`region_code`, `province_code`) ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
